  \"2016-07-27T22:40:59.922294\",\n\t\"name\": \"ouray-national-wildlife-refuge-and-colorado-river-wildlife-management-area-narrative-repo--02416\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ouray
  National Wildife Refuge outlines Refuge accomplishments during the 2009 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, volunteer programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, forests, croplands, grasslands, fire management, pest control, and water
  rights. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, wildlife propagation, animal control, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, and computer
  systems. Items of interest are provided at the end\",\n\t\"license_title\": \"License
